import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import 'bootstrap/dist/css/bootstrap.min.css'; // Bootstrap CSS 임포트

function ColorSchemesExample() {
  return (
    <>
      {/* 상단 고정 + 길이 조정 */}
      <Navbar bg="dark" data-bs-theme="dark" fixed="top" style={{ height: '80px' }}>
        <Container>
          <Navbar.Brand href="#home" style={{ fontSize: '1.5rem' }}>
            개발팀
          </Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#home" style={{ fontSize: '1.2rem' }}>
              공지사항
            </Nav.Link>
            <Nav.Link href="#features" style={{ fontSize: '1.2rem' }}>
              Features
            </Nav.Link>
            <Nav.Link href="#pricing" style={{ fontSize: '1.2rem' }}>
              Pricing
            </Nav.Link>
          </Nav>
        </Container>
      </Navbar>

      {/* 네비게이션 바 아래의 콘텐츠가 겹치지 않도록 여백 추가 */}
      <div style={{ marginTop: '100px' }}>
        <h1>Content below the Navbar</h1>
        <p>여기에 추가 콘텐츠를 입력하세요.</p>
      </div>
    </>
  );
}

export default ColorSchemesExample;
